import React from 'react';
import './Matches-sectie.css';

const MatchesSection = () => {
    return (
        <section className="matches-section">
            <div className="top-matches">
                <h2>Top 5 matches vandaag</h2>
                <div className="matches">
                    {[...Array(5)].map((_, index) => (
                        <div key={index} className="match-card">Match {index + 1}</div>
                    ))}
                </div>
            </div>
            <div className="your-matches">
                <h2>Jouw matches</h2>
                <div className="matches">
                    {[...Array(6)].map((_, index) => (
                        <div key={index} className="match-card">
                            Match {index + 1}
                            <div className="actions">
                                <button>üëç</button>
                                <button>üëé</button>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
            <div className="recent-liked">
                <h2>Recent geliked</h2>
                <div className="liked">
                    {[...Array(3)].map((_, index) => (
                        <div key={index} className="like-card">Like {index + 1} üëç</div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default MatchesSection;
